import React from 'react';
import { BiListCheck, BiTask } from 'react-icons/bi';
import { AiOutlineUserAdd, AiOutlineUsergroupAdd } from 'react-icons/ai';
import { MdLocalGroceryStore } from 'react-icons/md';
import { FiUser } from 'react-icons/fi';
import { Link } from 'react-router-dom';
import Container from '../../components/Container';
import { Content } from './styles';
import FloatMenu, { FloatMenuItem } from '../../components/FloatMenu';

const Register: React.FC = () => {
  return (
    <Container>
      <Content>
        <FloatMenu name="Cadastros Usu치rio" icon={FiUser}>
          <FloatMenuItem
            icon={AiOutlineUserAdd}
            name="Cadastrar"
            url="/user-register"
          />
          <FloatMenuItem icon={BiListCheck} name="Listar" url="/teste" />
        </FloatMenu>

        <FloatMenu name="Cadastro Grupo Usu치rios" icon={AiOutlineUsergroupAdd}>
          <FloatMenuItem
            icon={AiOutlineUsergroupAdd}
            name="Cadastrar"
            url="/group-user-register"
          />
          <FloatMenuItem icon={BiListCheck} name="Listar" url="/teste" />
        </FloatMenu>

        <FloatMenu name="Cadastro Produtos" icon={MdLocalGroceryStore}>
          <FloatMenuItem
            icon={MdLocalGroceryStore}
            name="Cadastrar"
            url="/teste"
          />
          <FloatMenuItem icon={BiListCheck} name="Listar" url="/teste" />
        </FloatMenu>

        <Link to="user-register">
          <FiUser size={35} />
          <strong>Cadastro Usu치rios</strong>
        </Link>
        <Link to="group-user-register">
          <AiOutlineUsergroupAdd size={35} />
          <strong>Cadastro Grupo Usu치rios</strong>
        </Link>
        <Link to="group-user-register">
          <MdLocalGroceryStore size={35} />
          <strong>Cadastro Produtos</strong>
        </Link>
      </Content>
    </Container>
  );
};

export default Register;
